// ColorList.js
import React from 'react';
import { Link } from 'react-router-dom';

const ColorList = ({ colors }) => {
  return (
    <div>
      <h1>Colors</h1>
      <ul>
        {colors.map(color => (
          // Use color.name instead of color.id in the Link component
          <li key={color.id}>
            <Link to={`/colors/${color.name}`}>{color.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ColorList;
